import React from 'react';
import './Dashboard.css';

export const Exoclassifier: React.FC = () => {
  const url = 'https://exoclassifiergit-af2wfqnc548f76gsgr5g3u.streamlit.app/';

  return (
    <div className="dashboard">
      <header>
        <h1>Exoclassifier</h1>
        <p className="small-muted">Embedded Exoclassifier tool. If the embed is blocked, open in a new tab.</p>
      </header>

      <div className="input-section">
        <div style={{ marginBottom: 12 }}>
          <a href={url} target="_blank" rel="noopener noreferrer" className="primary-btn">Open Exoclassifier in new tab</a>
        </div>

        <div style={{ width: '100%', minHeight: 600, borderRadius: 8, overflow: 'hidden', boxShadow: '0 8px 30px rgba(0,0,0,0.4)'}}>
          <iframe
            src={url}
            title="Exoclassifier"
            style={{ width: '100%', height: '720px', border: 'none' }}
          />
        </div>
      </div>
    </div>
  );
};
